// SPDX-License-Identifier: BSD-3-Clause
/// @title Dexhune ERC20 Root Implementation


/*
*    ||_ __  __         
*   (|| |  \/  \|__||   
*   _||)|__/\__/|  ||__ 
*    ||                 
*/

pragma solidity ^0.8.28;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./Ownable.sol";
import "./interfaces/AggregatorInterface.sol";


contract DOHL is ERC20, Ownable {
    uint256 public price;
    address public lp;
    address public tokenZero;

    AggregatorInterface public aggregator;

    uint256 private constant INITIAL_SUPPLY = 4e18;

    constructor() ERC20("Link Dollar", "DOHL") { 
        _mint(_owner, INITIAL_SUPPLY);    
    }

    function initialize(address lpAddr, address aggregatorAddr, address tokenZeroAddr) external onlyOwner {
        require(lp == address(0));
        require(tokenZero == address(0));

        lp = lpAddr;
        tokenZero = tokenZeroAddr;
        aggregator = AggregatorInterface(aggregatorAddr);

        _mint(lp, 1e18);
    }

    // override function transferFrom(address from, address to, uint256 value) public virtual returns (bool) {
    //     address spender = _msgSender();
        
    //     // _spendAllowance(from, spender, value);
    //     // _transfer(from, to, value);
    //     return true;
    // }
}

contracts/interfaces/AggregatorInterface.content:
// SPDX-License-Identifier: BSD-3-Clause
/// @title AggregatorInterface


/*
*    ||_ __  __         
*   (|| |  \/  \|__||   
*   _||)|__/\__/|  ||__ 
*    ||                 
*/

pragma solidity ^0.8.28;


interface AggregatorInterface {
  function latestAnswer() external view returns (int256);
  function latestTimestamp() external view returns (uint256);
  function latestRound() external view returns (uint256);
  function getAnswer(uint256 roundId) external view returns (int256);
  function getTimestamp(uint256 roundId) external view returns (uint256);

  event AnswerUpdated(int256 indexed current, uint256 indexed roundId, uint256 updatedAt);
  event NewRound(uint256 indexed roundId, address indexed startedBy, uint256 startedAt);
}

contracts/Ownable.sol.content:
// SPDX-License-Identifier: BSD-3-Clause
/// @title Owner Base Class
/*
*    ||_ __  __         
*   (|| |  \/  \|__||   
*   _||)|__/\__/|  ||__ 
*    ||                 
*/
pragma solidity ^0.8.28;

interface IOwnable {
    function transferOwnership(address newOwner) external;
}

contract Ownable is IOwnable {
    address internal _owner;

    event OwnershipRenounced(address indexed previousOwner);

    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );

    constructor() {
        _owner = msg.sender;
    }

    function owner() public view returns (address) {
        return _owner;
    }

    modifier onlyOwner() {
        require(isOwner());
        _;
    }

    function isOwner() public view returns (bool) {
        return msg.sender == _owner;
    }

    function renounceOwnership() public onlyOwner {
        emit OwnershipRenounced(_owner);
        _owner = address(0);
    }

    function transferOwnership(address newOwner) public onlyOwner {
        _transferOwnership(newOwner);
    }

    function _transferOwnership(address newOwner) internal {
        require(newOwner != address(0));
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

